<img alt="" data-savepage-currentsrc="http://globalincomestrategy.com/fr-rish/2.jpg" data-savepage-src="./2.jpg" src="data:image/jpeg;base64," style="width: 100%;"><p>L'émission touchait à sa fin et Patrick n'a pas eu le temps d'expliquer en détail sa stratégie, alors nous avons obtenu un entretien exclusif avec lui pour en savoir plus sur cette astuce controversée.</p>

